import React, { useState, useEffect } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip } from 'recharts';

interface Props {
  type: 'voltage' | 'current' | 'temperature';
  objectId: number;
  onClose: () => void;
}

const ChartModal: React.FC<Props> = ({ type, objectId, onClose }) => {
  const [data, setData] = useState<any[]>([]);
  useEffect(() => {
    fetch(`/api/objects/${objectId}/data?type=${type}`)
      .then(res => res.json())
      .then(setData);
  }, [objectId, type]);

    const downloadCSV = () => {
    const header = 'timestamp,value\n';
    const rows = data.map(d => `${d.timestamp},${d.value}`).join('\n');
    const blob = new Blob([header + rows], { type: 'text/csv;charset=utf-8;' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = `${type}_${objectId}_data.csv`;
    a.click();
    URL.revokeObjectURL(url);
  };

  return (
    <div className="modal">
      <div className="modal-content" style={{ display: 'flex', flexDirection: 'column', background: '#000', padding: 20, color: '#FFD014', fontFamily: 'Roboto' }}>
        <button onClick={onClose} style={{ alignSelf: 'flex-end', fontSize: 18, background: 'transparent', border: 'none', color: '#FFD014' }}>×</button>
        <h2 style={{ margin: '0 0 16px' }}>{type}</h2>

        <div style={{ display: 'flex', gap: 20 }}>
          {/* График */}
          <LineChart width={600} height={300} data={data}>
            <CartesianGrid stroke="#444" />
            <XAxis dataKey="timestamp" tick={{ fill: '#FFD014' }} />
            <YAxis tick={{ fill: '#FFD014' }} />
            <Tooltip
              contentStyle={{ backgroundColor: '#000', borderColor: '#FFD014' }}
              labelStyle={{ color: '#FFD014' }}
              itemStyle={{ color: '#FFD014' }}
            />
            <Line type="monotone" dataKey="value" stroke="#FFD014" dot={{ r: 3 }} />
          </LineChart>

          {/* Таблица */}
          <div style={{ maxHeight: 300, overflowY: 'auto' }}>
            <button onClick={downloadCSV} style={{ marginBottom: 8, background: '#222', color: '#FFD014', border: '1px solid #FFD014', padding: '4px 8px', cursor: 'pointer' }}>
              Скачать CSV
            </button>
            <table style={{ borderCollapse: 'collapse', width: '100%' }}>
              <thead>
                <tr>
                  <th style={{ border: '1px solid #444', padding: 4 }}>Время</th>
                  <th style={{ border: '1px solid #444', padding: 4 }}>Значение</th>
                </tr>
              </thead>
              <tbody>
                {data.map((d, i) => (
                  <tr key={i}>
                    <td style={{ border: '1px solid #444', padding: 4, color: '#FFD014' }}>{d.timestamp}</td>
                    <td style={{ border: '1px solid #444', padding: 4, color: '#FFD014' }}>{d.value}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ChartModal;
